const fs = require('fs');

// Python에서 출력된 Base64 문자열 (예시)
const base64String = ""
const buffer = Buffer.from(base64String, 'base64');
console.log(buffer)
// Buffer를 이미지 파일로 저장
fs.writeFile('test_image.jpg', buffer, (err) => {
  if (err) {
    console.error('Error saving image:', err);
  } else {
    console.log('Image saved to test_image.jpg');
  }
});